"use client";
import React from "react";

const GlyphInspectClip = () => {
  const [pos, setPos] = React.useState({ x: 0, y: 0 });
  const [componentRect, setComponentRect] = React.useState({ left: 0, top: 0 });
  const [isSmallScreen, setIsSmallScreen] = React.useState(false);
  const containerRef = React.useRef<HTMLDivElement>(null);

  React.useEffect(() => {
    const handleMouseMove = (e: MouseEvent) => {
      setPos({ x: e.clientX, y: e.clientY });
    };

    const updateComponentRect = () => {
      if (containerRef.current) {
        const rect = containerRef.current.getBoundingClientRect();
        setComponentRect({ left: rect.left, top: rect.top });
      }
    };

    const handleResize = () => {
      setIsSmallScreen(window.innerWidth < 768); // md breakpoint
      updateComponentRect();
    };

    window.addEventListener("mousemove", handleMouseMove);
    window.addEventListener("resize", handleResize);
    window.addEventListener("scroll", updateComponentRect);

    // Initial setup
    handleResize();

    return () => {
      window.removeEventListener("mousemove", handleMouseMove);
      window.removeEventListener("resize", handleResize);
      window.removeEventListener("scroll", updateComponentRect);
    };
  }, []);

  // Calculate relative position for the clip path
  const relativeX = pos.x - componentRect.left;
  const relativeY = pos.y - componentRect.top;

  // Create a circular clip path around the mouse position
  const clipPathId = "circular-clip";
  const circleRadius = isSmallScreen ? 80 : 160; // Responsive circle size

  return (
    <div
      ref={containerRef}
      className="relative w-full bg-black rounded-md overflow-clip outline-neutral-50/10 outline-1"
    >
      <div className="absolute inset-0">
        <Base />
      </div>
      <div
        style={{
          clipPath: `url(#${clipPathId})`,
        }}
      >
        <Overlay />
      </div>

      <svg
        style={{
          position: "absolute",
          width: 0,
          height: 0,
          overflow: "hidden",
        }}
        aria-hidden="true"
      >
        <defs>
          <clipPath id={clipPathId}>
            <circle cx={relativeX} cy={relativeY} r={circleRadius} />
          </clipPath>
        </defs>
      </svg>
    </div>
  );
};

export default GlyphInspectClip;

